import React from "react";
import { Component } from "react";

class DisplayUnionOverview extends Component {

    render(){

        return(

            <div >

              { this.props.products.map((product, key) => {
                return(
                  <div className="product" key={key} >
                   <div className="product_organic"> allah</div>
                    <ul id="postList" className="list-group list-group-flush">
                      <li className="list-group-item">
                      <p>UPC :   <input  value={product.upc.toNumber()}/></p>  
                      <p>NAME: <input value={product.productname} /> </p>
                      <p>Price:  {product.price.toNumber()} </p>
                        {/* <p>ABOUT:   {product.productdescription}</p> */}

                      </li>
                    </ul>
                    </div>

                )
              }
              )
            }


            </div>


        )
    }
}

export default DisplayUnionOverview;
